using System; namespace Catalog.Models {     public class UserCatalog     {         private UserCatalog()         {         }          public Status makeNewUser(String email,                                 String passwordHashed,                                 bool isAdmin,                                 String phoneNumber,                                 String physicalAddress,                                 String firstName, String lastName)         {             User newUser;              if (isAdmin)                 newUser = new Admin(email, passwordHashed, isAdmin, phoneNumber, physicalAddress, firstName, lastName);             else                 newUser = new User(email, passwordHashed, isAdmin, phoneNumber, physicalAddress, firstName, lastName);              Status status = new Status(0, "User Added");              try             {                 users.add(newUser);              }             catch (Exception e)             {                 status.number = 1;                 status.message = "User Not Added";             }              return status;         }     } }  